E_D("replace into `www_92game_net_enewstags` values('634','花豹','0','0','6','花豹是大型肉食性动物，通常都是生活于森林、灌丛、湿地、荒漠等环境，其巢穴多筑于浓密树丛、灌丛或岩洞中。营独居生活，常夜间活动，白天在树上或岩洞休息。其主要特征是头小尾长，四肢短健；毛被黄色，满布黑色环斑；头部的斑点小而密，背部的斑点密而较大，斑点呈圆形或椭圆形的梅花状图案，又颇似古代的铜钱，所以又有“金钱豹”之称\','','花豹,花豹图片,花豹图片大全');");
