E_D("replace into `www_92game_net_enewstags` values('636','老鹰','0','1','6','老鹰和一般鸟类有点不同，老鹰属於禽兽类。这是因为老鹰性情凶猛，嘴呈黄色，上嘴弯曲，脚强健有力，趾有锐利的爪，翼大善飞。同时老鹰有双锐利的眼睛，可以看见数千米甚至更远。同时还是卵生恒温动物。今天就跟着27270老鹰频道一起看看凶猛的老鹰,老鹰图片,卡通老鹰图片,老鹰图片大全吧！','','老鹰图片,卡通老鹰图片,老鹰图片大全');");
E_D("replace into `www_92game_net_enewstags` values('637','斑马','0','1','6','斑马因身上有起保护作用的斑纹而得名，每只斑马身上的条纹都不一样。同时斑马也是是草食性动物。除了草之外，灌木、树枝、树叶甚至树皮也是它们的食物。适应能力较强的消化系统，令斑马可以在低营养条件下生存，比其他草食性动物优胜。下面一起看看唯美的斑马,斑马图片,卡通斑马图\,斑马图片大全吧！','','斑马,斑马图片,卡通斑马图\,斑马图片大全');");
E_D("replace into `www_92game_net_enewstags` values('638','河马','0','0','6','河马是陆地上仅次于非洲象、亚洲象、非洲森林象、白犀牛、印度犀牛的哺乳动物，同时河马也是是一种两栖动物，喜群居，善游泳，怕冷，喜温暖的气候。它们的皮肤长时间离水会干裂，而生活中的觅食、交配、产仔、哺乳也均在水中进行。接下来一起看看高清的河马,大河\,小河\,河马图片,河马图片大全吧！','','河马,河马图片,河马图片大全');");
E_D("replace into `www_92game_net_enewstags` values('639','海葵','0','0','6','海葵看上去很像花朵，但其实是捕食性动物，是中国各地海滨最常见的无脊椎动物之一，它没有骨骼，锚靠在海底固定的物体上，如岩石和珊瑚，或者固定在寄居蟹的外壳上。接下来一起看看唯美的海葵,海葵图片,海葵图片大全吧！','','海葵,海葵图片,海葵图片大全');");
E_D("replace into `www_92game_net_enewstags` values('640','雪纳\','0','0','5','雪纳瑞犬属于梗类犬的一种，也是是唯一在梗犬类中不含英国血统的品种。雪纳瑞典型的迷你雪纳瑞是勇敢的、警惕的，同时也是驯服的。他非常友好，聪明，喜欢取悦主人。既无侵略性，也不会过于胆怯。今天就\27270雪纳瑞频道与您分享可爱的雪纳\,雪纳瑞图\,小型雪纳瑞犬,巨型雪纳\,白色雪纳\,雪纳瑞犬吧！','/d/file/p/2016/09/11/al0bu10fhwl.jpg','雪纳\,雪纳瑞图\,小型雪纳瑞犬,巨型雪纳\');");
