E_D("replace into `www_92game_net_enewstags` values('772','猴子','0','1','6','猴子是灵长动物的代表，这是由于猴子是动物界最高等的类\,大脑发达；眼眶朝向前方，眶间距窄；而且猴子的好奇心特别\,这是它的优点,也是它的缺点,因此人们常利用这个弱点来设计猴子。自古以\,人、猴之间,不知道产生了多少妙事轶闻。接下来一起欣赏乖巧的猴子图片,小猴子图\,可爱猴子,小猴\,卡通猴子图片吧\','','猴子图片,小猴子图\,卡通猴子图\');");
