E_D("replace into `www_92game_net_enewstags` values('1110','火影忍\','0','0','21','作为现下最热门的动\,《火影忍者》是日本漫画家岸本齐史的代表作，作品\1999年开始在《周刊少年JUMP》上连载，于2014\11\10日发售的JUMP\50号完结；后日谈性质的外传漫画《火影忍者外传：第七代火影与绯色花月》则于同杂志2015年第22\23合并号开始短期连载，至同年第32号完结。接下来火影忍者频道提供了不少火影忍者高清壁\,同时还有火影忍者图\,火影忍者头像，赶紧进来挑选吧\','','火影忍\,火影忍者图\,火影忍者壁\,火影忍者头\');");
